function attachNameListener(){$("a#name").on("click",function(t){if(t.preventDefault(),$("input#contact_name").val()){getJSONRobot($("input#contact_name").serialize())}})}function attachStaffListener(){$("a#staff").on("click",function(t){if(t.preventDefault(),$("input#contact_email").val()){getJSONRobot($("input#contact_email").serialize())}})}function attachUnclaimedListener(){$("a#unclaimed").on("click",function(t){t.preventDefault(),getJSONRobot({unclaimed:"true"})})}function attachAllListener(){$("a#all").on("click",function(t){t.preventDefault(),getJSONRobot({all:"true"})})}function attachRecentlyUpdatedListener(){$("a#recently_updated").on("click",function(t){t.preventDefault(),getJSONRobot({recently_updated:"true"})})}function getJSONRobot(t){$("tbody").empty(),$.getJSON("/contacts.json",t,function(t){null!=t&&(typeof t!==Array&&(t=[].concat(t)),t.map(function(t){let n=tableHtmlPrinter(new Contact(t));$("tbody").append(n)}))})}function tableHtmlPrinter(t){return`<tr>\n    <td>${t.name}</td>\n    <td>\n      <a href="/contacts/${t.id}/edit">\n        <i class="material-icons">edit</i>\n      </a>\n      <a href="/contacts/${t.id}">\n        <i class="material-icons">zoom_in</i>\n      </a>\n    </td>\n    <td>${t.staff_name}</td>\n    <td>${t.email}</td>\n    <td>${t.gender}</td>\n  </tr>`}$(document).ready(function(){attachNameListener(),attachStaffListener(),attachUnclaimedListener(),attachAllListener(),attachRecentlyUpdatedListener()});class Contact{constructor(t){this.id=t.id,this.name=t.name,this.email=t.email||"N/A",this.staff_name=t.user.email.split("@",1)[0]||"N/A",this.gender=t.gender||"N/A"}}